import React from 'react';

const LeafIcon = ({type}) => {
    console.log(type)
    if(type === 'biała'){
        type = 'biala'
    }
    return <div className={`teaString_leaf-icon leaf-icon-${type}`}></div>
}

export default LeafIcon;
